import './App.css';
import NavBar from './components/NavBar/NavBar'
import WebFont from 'webfontloader';



function App() {
  useEffect(() => {
    WebFont.load({
      google: {
        families: ['Source Sans Pro']
      }
    });
   }, []);
  return (
    <div>
      <NavBar />
    </div>
  );
}

export default App;
